function rootReducer(
  state = {
    logs: [],
    count: [],
    user: {}
  },
  action
) {
  switch (action.type) {
    case "grid":
      return {
        logs: action.logs,
        count: state.count,
        user: state.user
      };
    case "dashboard":
      return {
        logs: state.logs,
        count: action.count,
        user: state.user
      };
    case "fetch_users":
      return {
        logs: state.logs,
        count: state.count,
        user: action.user
      };
    default:
      return state;
  }
}

export default rootReducer;
